svg.script:

var svgNS = "http://www.w3.org/2000/svg";
var cartoNS = "http://www.carto.net/attrib";
var xlinkNS = "http://www.w3.org/2000/xlink/namespace/";
function init(evt) {
	colorRegion();
}

function showData(evt) {
	//does nothing
}

function colorRegion() {
	var myGroup = document.getElementById("states");
	var children = myGroup.childNodes;
	var myRegion;

	//loop over all children
	for (var i = 0; i < children.length;i++) {
		//check if it is a path-element
		if (children.item(i).nodeName == "path") {
			myRegion = children.item(i).getAttributeNS(cartoNS,"SUB_REGION");
			switch (myRegion) {
				case "Pacific":
					myColor = "lightskyblue";
					break;
				case "Mtn":
					myColor = "lightsalmon";
					break;
				case "W S Cen":
					myColor = "gold";
					break;
				case "S Atl":
					myColor = "aquamarine";
					break;
				case "W N Cen":
					myColor = "wheat";
					break;
				case "N Eng":
					myColor = "lightgreen";
					break;
				case "Mid Atl":
					myColor = "greenyellow";
					break;
				case "S Atl":
					myColor = "orange";
					break;
				case "E S Cen":
					myColor = "thistle";
					break;
				case "E N Cen":
					myColor = "coral";
					break;
				default:
					myColor = "red";
			}
			children.item(i).setAttributeNS(null,"fill",myColor);
		}
	}			
}


function checkBoxScript(evt,myLayer) { //checkBox for toggling layers an contextMenue
	var myLayerObj = document.getElementById(myLayer);
	var myCheckCrossObj = document.getElementById("checkCross"+myLayer);
	var myCheckCrossVisibility = myCheckCrossObj.getAttributeNS(null,"visibility");
	if (evt.type == "click") {
		if (myCheckCrossVisibility == "visible") {
			myLayerObj.setAttributeNS(null,"visibility","hidden");
			myCheckCrossObj.setAttributeNS(null,"visibility","hidden");
		}
		else {
			myLayerObj.setAttributeNS(null,"visibility","visible");		
			myCheckCrossObj.setAttributeNS(null,"visibility","visible");
		}
	}
}
